description:
I det hemliga sallskapet ar tavlandet brutalt och insatserna hoga. 
Det ar den osanktionerade, underground och osofistikerade varlden 
av Bordtennis turneringar. Fore detta pingisfenomenet, Randy Daytona, 
rekryteras av FBI for att under tackmantel ta sig in.
Med Maggie Q, Christopher Walken, Masi Oka m fl. 

